import React from 'react'
import {
  View,
  Button,
  Image,
  TouchableOpacity,
  Text,
  StyleSheet
} from 'react-native';

const Chat = ({navigation}) => { 
  return (
    <View style={styles.container}>
    <Text style={{
        color: 'black',
        fontSize: 25,
        }}>
        This is Chat
    </Text>
    <Button title="Shop1"
            onPress={() => navigation.navigate('Shop1')}
    />
</View>
  )
  
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent:'center',
    alignItems: 'center',
    alignContent:'center',
    backgroundColor: 'powderblue',
},

})
export default Chat;
